draw((0,3)--(10,3));
draw((2,3)--(8,0));
draw((2,3)--(4,0));
label("$A$",(2,3),N);
label("$B$",(4,0),S);
label("$C$",(8,0),S);
label("$124^{\circ}$",(2,3),SW);
